import './login.css';

const Login = () =>{
    return (
        <>
        <div><h1>Log In</h1></div>
        <input type="text" placeholder="E-mail"/>
        <input type="text"placeholder="Password" />
        <button>Log In</button>
        </>
    );
}
export default Login;
